package com.syntax.class7;

public class MultiplicaitonsTable {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int num=9;
		for (int i=1; i<=10; i++) {
			System.out.println(num+"X"+ i+"+"+num*i);
		}
		System.out.println("*************************");
		for (int i=1; i<=20; i+=2) {
			System.out.println(i+" ");
			
		}
		System.out.println(i);
	}

}
